// src/components/App.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Row, Col } from 'react-bootstrap';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import TimelineGraph from './components/TimelineGraph';
import SummaryTable from './components/SummaryTable';

const App = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    // Mocked data for demonstration
    const mockedData = [
      { id: 1, ts: "2024-01-21 08:53:48", vibration: 0 },
      { id: 2, ts: "2024-01-21 10:00:00", vibration: 1 },
      { id: 3, ts: "2024-01-21 11:00:00", vibration: 1 },
      { id: 4, ts: "2024-01-21 16:53:56", vibration: 0 }
    ];

    setData(mockedData);
  };

  return (
    <Router>
      <Container>
        <h1>React Timeline Graph</h1>
        <nav>
          <ul>
            <li>
              <Link to="/">Timeline Graph</Link>
            </li>
            <li>
              <Link to="/summary">Summary Table</Link>
            </li>
          </ul>
        </nav>
        <Switch>
          <Route path="/" exact>
            <Row>
              <Col>
                <TimelineGraph data={data} />
              </Col>
            </Row>
          </Route>
          <Route path="/summary">
            <Row>
              <Col>
                <SummaryTable data={data} />
              </Col>
            </Row>
          </Route>
        </Switch>
      </Container>
    </Router>
  );
};

export default App;
